import React, { useEffect, useState } from "react";

// Styles
import "./app.scss";
import "bootstrap/dist/css/bootstrap.css";


// Components
import { Navbar } from 'react-bootstrap';
import { Container } from 'react-bootstrap';
import { Nav } from "react-bootstrap";
import Header from "./components/Header";
import Footer from "./components/Footer";
import { Customer } from "./section/Customer";
import { Tab } from "./components/Header/Tab";

function App() {
  const [selected, setSelected] = useState('Products');
  return (
    <div className = "app mt-4">
      {/* <Header /> */}
      {/* <Header tabs = {['Products', 'Orders', 'Customers', 'Suppliers']} selected = {selected} setSelected = {(tab) => setSelected(tab)}>
        <Tab isSelected = {selected === 'Products'}>
          Products
        </Tab>
        <Tab isSelected = {selected === 'Orders'}>
          Orders
        </Tab>
        <Tab isSelected = {selected === 'Customers'}>
          <Customer />
        </Tab>
        <Tab isSelected = {selected === 'Suppliers'}>
          Suppliers
        </Tab>
      </Header> */}
      <ul class="nav nav-tabs" id="myTab" role="tablist">
        <li class="nav-item" role="presentation">
          <button class="nav-link active" id="home-tab" data-bs-toggle="tab" data-bs-target="#home" type="button" role="tab" aria-controls="home" aria-selected="true">Home</button>
        </li>
        <li class="nav-item" role="presentation">
          <button class="nav-link" id="profile-tab" data-bs-toggle="tab" data-bs-target="#profile" type="button" role="tab" aria-controls="profile" aria-selected="false">Profile</button>
        </li>
        <li class="nav-item" role="presentation">
          <button class="nav-link" id="contact-tab" data-bs-toggle="tab" data-bs-target="#contact" type="button" role="tab" aria-controls="contact" aria-selected="false">Contact</button>
        </li>
      </ul>
      <div class="tab-content" id="myTabContent">
        <div class="tab-pane fade show active" id="home" role="tabpanel" aria-labelledby="home-tab">...</div>
        <div class="tab-pane fade" id="profile" role="tabpanel" aria-labelledby="profile-tab">...</div>
        <div class="tab-pane fade" id="contact" role="tabpanel" aria-labelledby="contact-tab">...</div>
      </div>      
      <Footer />
    </div>
  );
}

export default App;
